import { BottomNavigation, BottomNavigationAction, Button } from '@mui/material'
import React from 'react'
import FolderIcon from '@mui/icons-material/Folder';
import HomeIcon from '@mui/icons-material/Home';import FavoriteIcon from '@mui/icons-material/Favorite';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const Footer = () => {
  return (
      <BottomNavigation type sx={{ width: 500 }} >
               <Button color="inherit">{<HomeIcon/>}</Button>

      <BottomNavigationAction
        label="Favorites"
        value="favorites"
        icon={<FavoriteIcon />}
      />
      <BottomNavigationAction
        label="Nearby"
        value="nearby"
        icon={<LocationOnIcon />}
      />
      <BottomNavigationAction label="Folder" value="folder" icon={<FolderIcon />} />
    </BottomNavigation>
  )
}

export default Footer
